snippet.description:
Ja. Ich weiß, dass die schweizer Flagge falsch ist. Ich wurde bereits mehrfach darauf hingewiesen und habe den Befehl für die Flagge korrigiert. Die richtige Flagge könnt ihr euch auch im 2. Teil anschauen. (https://youtu.be/U1OYog16SwA)
--------------------------------------------------
Erstellt auf Snapshot 14w30c.
Ein neuer Snapshot ist raus und es gibt einiges neues. Die neuen Banner kann man sehr individuell gestalten - so wie nie etwas in Minecraft zuvor! Da hab´ ich mir doch gleich ein paar Flaggen geschnappt und nachdesignt.
Bitte lasst einen Kommentar zum Video da ⇩
___
Kommandos:
Deutschland: /setblock ~ ~2 ~-2 minecraft:wall_banner 1 1 {Base:1,Patterns:     [       {Color:11,Pattern:bs},       {Color:0,Pattern:ts}     ]   }

