Burundi: /setblock ~ ~2 ~-2 minecraft:wall_banner 1 1 {Base:10,Patterns:     [      {Color:1,Pattern:bt},  {Color:1,Pattern:tt}, {Color:15,Pattern:cr}, {Color:15,Pattern:mc}      ]   }

Zypern: /setblock ~ ~2 ~-2 minecraft:wall_banner 1 1 {Base:15,Patterns:     [{Color:11,Pattern:moj}, {Color:10,Pattern:bts}      ]   }

